record.text:
いいな〜
息子がステーキ食べたいって言うけどなかなか買おうって思える値段じゃない…^^;
お肉屋さんのお肉は美味しいだろうね🤤

5個はだめ〜🙅（笑）

パンパンな時勝手に冷凍庫半開きになるかもだから気をつけて（笑）
私ちょっと開いちゃったことがある^^;

フルーツも全部高いよね😣

みかんは箱買いした方が安いかなぁ？
今年どうしようかな^^;

そうだね〜！決めるのも働くのも息子だしね^^;
なんかついつい心配になっちゃうよね^^;
子離れしなくちゃ😵‍💫

心配に思ったこと息子に聞いたら、もちろん知ってるって言われた^^;
息子に任せればいいか〜…
心配しすぎかも…

確かにね^^;
息子に任せるのもアリだよね。

今帰ってきたから2社目候補の企業の働き方こんな感じなんだよ？大丈夫？って聞いたら、
「もちろん知ってる。」って言ってた😅
息子が分かってるならいいか…^^;

分かるよ〜私も時々SNS放置することがある🤭
毎日沢山いいねしたりマメに返事したりしてる人、どこにそんな時間あるの…？？って思っちゃう^^;

さつまいもに慣れたらじゃがいもが物足りなく感じた^^;
またさつまいも買わなきゃ😍

ちょっとは手を加えてるのかと思ってた^^;
描いてないのに自分のものって感じなの？💦
つまんなーい^^;

甘いだけじゃなかったよ😊
でもディグダの周りにあるクランチの下にあるクリームは余分だったかな^^;
クランチとホワイトチョコの間にうっすらあるの^^;

強い…😁🤭
面倒なのよひっくり返すの😭
時々綺麗に脱いでるけど自分で洗濯するまでは大変さ気付かないよね^^;

昔はフォートナイトだったけど今は分からないです^^;
でも似たようなやつ（笑）
なんだっけな〜💦
